    false,nt"url": null,nt"notes": "The Resource Assessment and Conservation
    Engineering Division (RACE) of the Alaska Fisheries Science Center (AFSC) conducts
    bottom trawl surveys to monitor the condition of the demersal fish and crab stocks
    of Alaska. These data include catch per unit effort for each commercially important
    crab species at a standard set of stations in the eastern Bering Sea. This is a
    subset of the main database. Excluded are certain non standard tows and other types
    of data collected other than species id, species size category, species catch per
    unit effort (number per square nautical mile), water temperature and depth.",nt"owner_org":
